// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TicTacToe {
    enum Player { X, O, None }

    struct Game {
        Player[] board; // Game board represented as an array
        Player currentPlayer;
        Player winner;
    }

    mapping(uint256 => Game) public games; 

    event GameCreated(uint256 gameId);
    event MoveMade(uint256 gameId, uint256 position, Player player);
    event GameOver(uint256 gameId, Player winner);

    function createGame() public returns (uint256 gameId) {
        gameId = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender))); 
        games[gameId] = Game({
            board: new Player[](9), // Initialize with empty board
            currentPlayer: Player.X,
            winner: Player.None
        });

        for (uint256 i = 0; i < 9; i++) {
            games[gameId].board[i] = Player.None;
        }

        emit GameCreated(gameId);
        return gameId;
    }

    function makeMove(uint256 gameId, uint256 position) public {
        require(position >= 0 && position < 9, "Invalid position");
        require(games[gameId].board[position] == Player.None, "Position already occupied");
        require(msg.sender == playerToAddress(games[gameId].currentPlayer), "Not your turn"); 

        games[gameId].board[position] = games[gameId].currentPlayer;

        // Check for win condition
        if (checkWin(gameId)) {
            games[gameId].winner = games[gameId].currentPlayer;
            emit GameOver(gameId, games[gameId].currentPlayer);
        } else if (isBoardFull(gameId)) {
            games[gameId].winner = Player.None; // Draw
            emit GameOver(gameId, Player.None);
        } else {
            // Switch players
            games[gameId].currentPlayer = 
                games[gameId].currentPlayer == Player.X ? Player.O : Player.X;
        }

        emit MoveMade(gameId, position, games[gameId].currentPlayer);
    }

    function checkWin(uint256 gameId) internal view returns (bool) {
        // Check rows
        for (uint256 i = 0; i < 3; i++) {
            if (
                games[gameId].board[i * 3] != Player.None &&
                games[gameId].board[i * 3] == games[gameId].board[i * 3 + 1] &&
                games[gameId].board[i * 3] == games[gameId].board[i * 3 + 2]
            ) {
                return true;
            }
        }

        // Check columns
        for (uint256 i = 0; i < 3; i++) {
            if (
                games[gameId].board[i] != Player.None &&
                games[gameId].board[i] == games[gameId].board[i + 3] &&
                games[gameId].board[i] == games[gameId].board[i + 6]
            ) {
                return true;
            }
        }

        // Check diagonals
        if (
            games[gameId].board[0] != Player.None &&
            games[gameId].board[0] == games[gameId].board[4] &&
            games[gameId].board[0] == games[gameId].board[8]
        ) {
            return true;
        }

        if (
            games[gameId].board[2] != Player.None &&
            games[gameId].board[2] == games[gameId].board[4] &&
            games[gameId].board[2] == games[gameId].board[6]
        ) {
            return true;
        }

        return false;
    }

    function isBoardFull(uint256 gameId) internal view returns (bool) {
        for (uint256 i = 0; i < 9; i++) {
            if (games[gameId].board[i] == Player.None) {
                return false;
            }
        }
        return true;
    }

    function playerToAddress(Player player) internal pure returns (address) {
        // This is a simplified example and may need adjustments based on your authentication method
        if (player == Player.X) {
            return address(0x1234567890123456789012345678901234567890); // Replace with actual player X address
        } else if (player == Player.O) {
            return address(0x9876543210987654321098765432109876543210); // Replace with actual player O address
        } else {
            return address(0);
        }
    }

    // Getters for React component
    function getBoard(uint256 gameId) public view returns (Player[] memory) {
        return games[gameId].board;
    }

    function getCurrentPlayer(uint256 gameId) public view returns (Player) {
        return games[gameId].currentPlayer;
    }

    function getWinner(uint256 gameId) public view returns (Player) {
        return games[gameId].winner;
    }
}

